export default class DogCard extends Component {

    render() {
        const {id, image, name} = this.props.dog
        return( 
            <div>
                 <Card 
                 image={image}
                 header={name}
                meta='Friend'
                description='Elliot is a sound engineer living in Nashville who enjoys playing guitar and hanging with his cat.'

                />
        </div>

        )
    }
}
